COMPONENT.script:
#define $thistype 'airline'
#define $main_key 'main_key'
#
//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
//				STARTUP
//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@

INITIALIZE(

	these		= ARRAY OF $thistype;				//holds object values (the "update" whereclause expects this name)

)=
DECLARE
	RM		= RequestManager;				//runtime frame handler
	that		= $thistype;					//holds object values (the "update" whereclause expects this name)
	$main_key	= IntegerObject;				//holds main key for attribute retrievals

ENDDECLARE
BEGIN
/*
**  Adjust the window at startup
*/
CurFrame.SendUserEvent(EventName='request', MessageVarchar='frame:realize');
END;



//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
//				EVENTS
//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@

/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Respond to the user's explicit request (usually a button click)
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
ON CHILDCLICK,
ON USEREVENT 'request' =
BEGIN
IF RM.RespondToRequest() = ER_FAIL THEN
	RESUME;
ENDIF;
END;


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//  Match the display size to the windowsize
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
ON WINDOWRESIZED =
BEGIN
CurFrame.SendUserEvent(EventName='request', MessageVarchar='frame:resize');
END;


//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//  Close the frame gracefully
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
ON WINDOWCLOSE =
BEGIN
CurFrame.SendUserEvent(EventName='request',
	MessageVarchar='frame:close', FocusBehavior=FT_NOSETVALUE);
RESUME;
END;

ON TERMINATE =
BEGIN
RETURN;
END;

row.script:
/*----------------------------------------------*/
/* tablefield initialize */

initialize =
declare
#   include _tfInitDecl
enddeclare
{
#   include _tfInit
}

ON SETVALUE _currow =
  DECLARE
  info		= IntegerObject;
  ENDDECLARE
BEGIN
_currow = _currow;			//essential
info.SetAttribute(Value = _currow);
CurFrame.SendUserEvent(
	'request', MessageVarchar='data:specified', MessageObject=info);
RESUME;
END;

/*----------------------------------------------*/
/* tablefield initialize */

initialize =
declare
#   include _tfInitDecl
enddeclare
{
#   include _tfInit
}

/*----------------------------------------------*/
/* tablefield initialize */

initialize =
declare
#   include _tfInitDecl
enddeclare
{
#   include _tfInit
}

/*----------------------------------------------*/
/* tablefield controlbutton menuitem Insert Before Current Row */

on click =
{
#   include _tfcbInsClick
}

/*----------------------------------------------*/
